import React, { Component } from 'react'
import { BrowserRouter as Router, Route } from 'react-router-dom'
import { Home, AppStoreA, AppStoreB } from '../pages'

class App extends Component {
    constructor(props){
        super(props)
        this.setState=({
            Afirst : true
        })
        console.log(this.state.Afirst)
    }
    render() {
        return (
            <Router>
            <div>
                <Route exact path="/" 
                render={(props) => <Home Afirst={this.Afirst} isAuthed={true}/>}/>
                <Route exact path="/appStoreA" component={AppStoreA}/>
                <Route exact path="/appStoreB" component={AppStoreB}/>
            </div>
            </Router>
        );
    }
}

export default App;
